          src="https://youxgroup.com.br/wp-content/uploads/2021/07/logosite.png"
        />
      </a>
      <div className="menu"></div>

      <div className="dadosUsuario">
        <hr className="vertical"></hr>
        <div className="dados">
          <Link to="/">Home</Link>
          <Link to="/logout">Logout</Link>
        </div>

        <div>
          <a>dados</a>
        </div>
      </div>
    </header>
  );
}

export default Header;
